leAnal:"Uso do Google Analytics",noPersonalDataText:"Podemos coletar informaes de identificao no pessoal sobre os usurios sempre que interagirem com nosso site. Essas informaes podem incluir o nome do navegador, o tipo de computador e informaes tcnicas sobre os meios de conexo dos usurios com nosso site, como o sistema operacional e os provedores de servios de internet utilizados, e outras informaes semelhantes.",noPersonalData:"Informaes de identificao no pessoal",personalData:"Podemos coletar informaes de identificao pessoal dos usurios de vrias maneiras, incluindo, mas no se limitando a, quando os usurios visitam nosso site, registram-se no site, assinam o boletim informativo, preenchem um formulrio, e em conexo com outras atividades, servios, recursos ou recursos que disponibilizamos em nosso site. Os usurios podem ser solicitados, conforme apropriado, a fornecer nome, endereo de e-mail, endereo postal, nmero de telefone. No entanto, os usurios podem visitar nosso site anonimamente. Coletaremos informaes de identificao pessoal dos usurios apenas se eles nos enviarem voluntariamente essas informaes. Os usurios sempre podem recusar-se a fornecer informaes de identificao pessoal, exceto que isso pode impedi-los de participar de determinadas atividades relacionadas ao site.",idInformation:"Informaes de identificao pessoal",information:"Coleta de informaes",privacyPolicy:'Esta Poltica de Privacidade descreve como o 4V.news coleta, usa, armazena e divulga as informaes obtidas dos usurios (cada um, "Usurio") do site 4V.news ("Site").',ps:"* no obrigatrio, mas recomendado para convenincia",createText:"Criar e enviar",createNews:"Criar notcia",autopostDoc:"No bloco de Postagem Automtica de Notcias, selecione o canal para postagem automtica, a hora e a data, e clique no boto de fila abaixo da notcia que voc escolheu para postagem automtica. No bloco de Postagem Automtica de Notcias, ao clicar no boto de enviar, a notcia ser colocada na fila.",autopost:"Postagem automtica"